import React from 'react';

function GameTiles() {
    return (
        <div className="game-tiles-container">
            <div className="game-tile">
                <img src="images/fib_game.png" width="250" alt="Game Image" />
                <p>Play fill in the blanks</p>
            </div>
            <div className="game-tile">
                <img src="images/wordle_logo.png" width="100%" alt="Game Image" />
                <p>Wordle</p>
            </div>
        </div>
    );
}

export default GameTiles;
